def generateReportHtml(failingTargetsList, targetErrorReports, failingTargetsBuildIDs):

    if not isinstance(failingTargetsList, list) or not isinstance(targetErrorReports, list):
        raise ValueError(f'{failingTargetsList} and {targetErrorReports} must be a list ')
    table_of_contents = ""
    target_error_string = ""
    target_num = 0 
    for target_name, error in zip(failingTargetsList, targetErrorReports):
        table_of_contents += f"<li><a href=\"#{target_num}\">{failingTargetsBuildIDs[target_num]} - {target_name} </a></li>"
        target_error_string += f"<hr>\n<h2 id=\"{target_num}\">{failingTargetsBuildIDs[target_num]} - {target_name} Errors</h2>"
        target_error_string += error
        target_num += 1
    
    # target_error_string = ""
    # target_num = 0
    # for error in targetErrorReports:
    #     target_name = failingTargetsList[target_num]
    #     target_error_string += f"<hr>\n<h2 id=\"{target_num}\">{failingTargetsBuildIDs[target_num]} - {target_name} Errors</h2>"
    #     target_error_string += error
    #     target_num += 1
        
    html_template = """\
        <html>
        <head>
        <title> JedAI </title>
        </head>
        <body>
        <h1> How to use this report </h1>
        <p>
        JedAI scans for line patterns that don't appear in logs from passing builds. Such lines are considered anomalies (i.e. errors).
        <br>
         Detected anomaly lines are <font color="red">highlighted in red.</font><br>
        </p>
        <h1 id = "toc">Failing Build Targets</h1>
        <ul> {table_of_contents} </ul>
        <ul> {target_error_string} </ul>
        </body>
        </html>
        """.format(**locals())
    
    return html_template


